import React from 'react';
import RenderVideo from '../Video';

export default function NextVideo() {
    return (
        <div>
            <div>
            {videos.map((video) => (
                <RenderVideo key={video.id} video={video} selectVideo={selectVideo}/>
        
            ))}
        </div>
        </div>
    )
}
